export default function GetLastPlayData(data) {

    const playerID = data.lpla.pid;

    const lastPlayData = {
        'clock': data.lpla.cl,
        'teamID': data.lpla.tid,
        'playerID': playerID,
        'eventType': data.lpla.etype,
        'event': data.lpla.evt,
        'messageType': data.mtype,
        'description': data.lpla.de,
        'locX': data.lpla.locX,
        'locY': data.lpla.locY,
        'opid': data.lpla.opid,
        'hs': data.lpla.hs,
        'vs': data.lpla.vs,
    };

    return lastPlayData;
}
